-- Table `users`
CREATE TABLE `users` (
  `id`        BIGINT(20)  NOT NULL AUTO_INCREMENT,
  `username`  VARCHAR(45) NOT NULL UNIQUE,
  `password`  VARCHAR(45) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE = InnoDB DEFAULT CHARSET = UTF8;

