-- Table `users_roles`
CREATE TABLE `users_roles` (
  `id`    BIGINT(20)  NOT NULL AUTO_INCREMENT,
  `user_id`    BIGINT(20)  NOT NULL,
  `role_id`    BIGINT(20)  NOT NULL,
  PRIMARY KEY (`id`),
  FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
